import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the search input using a different selector strategy (attribute selector)
    await page.waitForSelector('input[placeholder="Search Amazon"]', { timeout: 5000 });

    // Focus and type a search query that should trigger autocomplete
    const searchInput = await page.$('input[placeholder="Search Amazon"]');
    await searchInput.click();
    await searchInput.type('iPh');

    // Wait for the suggestions box using ID selector (created dynamically)
    await page.waitForSelector('#searchSuggestions', { timeout: 5000 });

    // Take screenshot of suggestions
    const step2 = path.join(screenshotsDir, 'step_2_suggestions.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Extract the suggestion texts (using .suggestion-item class)
    const suggestions = await page.$$eval('.suggestion-item', els => els.map(e => e.textContent.trim()));

    // Click the first suggestion using nth-of-type CSS selector
    const firstSuggestion = await page.$('.suggestion-item:nth-of-type(1)');
    if (firstSuggestion) {
      await firstSuggestion.click();
    }

    // Wait for the search results heading using text content
    await page.waitForSelector('h2:has-text("Search Results")', { timeout: 5000 });

    // Take screenshot of search results
    const step3 = path.join(screenshotsDir, 'step_3_results.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract the number of results from the .results-count element
    let resultsCountText = '';
    const resultsCountElem = await page.$('.results-count');
    if (resultsCountElem) {
      resultsCountText = await resultsCountElem.textContent();
    }

    // Extract the titles of the first 3 products in the results
    const productTitles = await page.$$eval('.product-title', nodes =>
      nodes.slice(0, 3).map(n => n.textContent.trim())
    );

    return {
      success: true,
      action: "Tested search autocomplete: triggered suggestions, selected one, and verified search results.",
      extractedData: {
        suggestions,
        resultsCountText,
        productTitles
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
